import React from "react";
function Help() {
  return (
    <div className="helmain">
      <div className="helbody">
        <div>
          <input type="text" placeholder="ENTER YOUR ISSUE" />
        </div>
        <div>
          <button>SUBMIT</button>
        </div>
      </div>
    </div>
  );
}
export default Help;
